def largest_unique_subarray(nums):
    best = 0
    n = len(nums)

    for i in range(n):
        seen = []
        for j in range(i, n):
            if nums[j] not in seen:     # add if new
                seen.append(nums[j])
                if len(seen) > best:
                    best = len(seen)
            else:                       # stop if repeated
                break
    return best

